import React from 'react';
import styles from './CSS/Main.module.css'
const Main = () => {
  return (
    <div className='styles.Main'>

      <main id='main' >
        <section id='picture'>
          <img src='https://cdn.fstoppers.com/styles/large-16-9/s3/lead/2019/01/tips-for-professional-portraits_jpg.webp'></img>
        </section>
        <section id='text-content'>
          <article id='name'>Harsh Devavanshi</article>
          <article id='bio'>Java Full Stack Expert</article>
        </section>
      </main>
    </div>
  );
};

export default Main;
